    for char in s:
        if char in counts:
            counts[char] += 1
        else:
            counts[char] = 1

    print(counts)
    prev = -1
    found = False
    for key in counts:
        if prev == -1:
            prev = counts[key]
            print(prev)
        elif prev != counts[key]:
            if abs(counts[key]-prev)>0 and found == True:
                print(found)
                print(counts[key]-prev)
                return 'NO'
            elif (abs(counts[key]-prev)>0):
                found = True

    return 'YES'

